/* eslint-disable prettier/prettier */
import styled from 'styled-components'
import Sheikh from '../assets/Images/shehudahir1.jpeg'

const Main = () =>  (
    <Wrapper>
        <img src={Sheikh} alt="Shehu Dahiru"/>
    </Wrapper>
)
const Wrapper = styled.div`
width:100%;
height:307px;
background-color:#309f5e;
margin-left:-30px;
margin-right:-15px;
margin-top:30px;
`
export default Main;
